import { Component } from '@angular/core';
import { faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { FooterComponent } from '../footer/footer.component';

@Component({
  selector: 'app-socials',
  templateUrl: './socials.component.html',
  styleUrls: ['./socials.component.scss']
})
export class SocialsComponent {
  github = faGithub;
  linkedin = faLinkedin;
  mail = faEnvelope;
}
<div class="socialStyle">
  <a href="https://github.com/uyentrannn"><fa-icon [icon]="github"></fa-icon></a>
  <a href="https://www.linkedin.com/in/uyentrannn/"><fa-icon [icon]="linkedin"></fa-icon></a>
  <a href="mailto:uyen.trannn98@gmail.com"><fa-icon [icon]="mail"></fa-icon></a>
</div>
